import { BrowserRouter as Router,Routes,Route } from 'react-router-dom';
import{ Navbar} from "./components/navbar";
import { Component } from 'react';

function App() {
  return (
    <div ClassName="App"><Router>
      <Navbar/>
      <Routes>
        <Route path ="/"/>
        <Route path ="/ cart"/>
      </Routes>
    </Router>
    </div>
  );
}

export default App;
